$(document).ready(function(){$("a.up-vote-answer").click(function(a){a.preventDefault();var t=$(a.target);$.ajax({type:"post",url:t.data("url"),data:t.data(),success:function(a){$("#answer-"+t.data("answer-id")).empty(),$("#answer-"+t.data("answer-id")).append(a)}})}),$(".up-vote-question").click(function(a){a.preventDefault();var t=$(a.target);$.ajax({type:"post",url:t.data("url"),data:t.data(),success:function(a){console.log(a),$("#question-"+t.data("question-id")).empty(),$("#question-"+t.data("question-id")).append(a)}})}),$("a.up-vote-comment").click(function(a){a.preventDefault();var t=$(a.target);console.log(t.data("url")),$.ajax({type:"post",url:t.data("url"),data:t.data(),success:function(a){console.log(a),$("#comment-"+t.data("comment-id")).empty(),$("#comment-"+t.data("comment-id")).append(a)}})})});